const App = () => {
  return (
    <>
      <Header />
      <div className="main">
        <main className="py-3">
          <Container>
            <h1>Welcome to E-COM TEST</h1>
            <Outlet />
          </Container>
        </main>
      </div>

      <Footer />
    </>
  );
};

export default App;
